('726901a0-d2a6-11e8-96a7-b9bb15888dc0', 'Corporate Social Responsibility Framework for Mindanao', '\"[{\\\"id\\\":0,\\\"name\\\":\\\"Dr. Anastacio G. Pantaleon-USEP-Bislig Campus\\\"},{\\\"id\\\":1,\\\"name\\\":\\\"Dr. Rec E. Eguia-USEP-Mintal Campus\\\"}]\"', '<h3>Abstract&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</h3><span lang=\"EN-PH\" style=\"line-height: 107%;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;The study aimed to develop a Corporate Social\r\nResponsibility (CSR) Framework for Mindanao. The elements comprising the\r\nframework are dimensions and agenda of CSR for Mindanao. Mixed method of\r\nqualitative and quantitative is the main research design in the process of\r\nconstructing the CSR framework through Survey and Delphi Technique,\r\nrespectively. The data collection was done electronically (through Facebook,\r\nEmail, and corporation websites) and conventionally (through enumerators and\r\npersonal encounters). Exploratory Factor Analysis (EFA) was employed on the\r\ndata of the survey in extracting thematic construct of CSR aided by Monte Carlo\r\nSimulation to come up with the dimensions. Modal, Content, and Thematic\r\nAnalysis was used iteratively in the three-round Delphi Technique to achieve\r\nconsensus on the agenda of CSR for Mindanao. Findings revealed that there are\r\nsix pillars of corporate social responsibility in Mindanao. These are conflict\r\nTransformation, Environmental Sustainability through Values Formation, Food\r\nSecurity and Agri-Tourism, Human Capital Governance, Community-Based Good\r\nGovernance, and Community-Based Disaster Preparedness and Response. This\r\nframework is hoped to give light to uncertainties on how corporations can effectively\r\nparticipate more for peace and development in Mindanao and perhaps applicable\r\nto the Philippines as a whole.</span><br>', 'Corporate  Social Responsibility Framework,Mindanao Monte Carlo Sumulation Delphi,Exploratory Factor Analysis ,Mixed Methodology', 4, 23, 236, '2017-01-01', '2017-12-01', 'Usep- Research division/ University Funded Project', '0', NULL, NULL, NULL, 'Corporate Social Responsibility framework for Mindanao.pdf', 164075, 1, 1, '5ed3c6a0-c880-11e8-9bd6-e11af0701d8a', '2018-10-17 23:21:36', '2018-10-17 23:21:36');
