('976a0820-d363-11e8-b900-673264f39654', 'Assessment of Existing Stands of Mollucansau (Falcata) Paraserianthes falcate (L.) Nielsen in USeP Bislig Campus: Search for Best Plus Trees', '\"[{\\\"id\\\":0,\\\"name\\\":\\\"FOR. WHELSON C. PASOS\\\"}]\"', '<h3>Abstract</h3><br><span lang=\"EN-PH\" style=\"line-height: 107%;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;The search for best candidate plus trees was\r\nconducted to: evaluate the phenotypic characteristics of existing stands in\r\nUSeP-Bislig Campus as initial drive to conduct tree improvement program\r\nespecially in establishing seed for production area (SPA) for academic use and\r\ngreen production as well.</span><br>', 'candidate plus,plus trees,seed production area,edaphic factors', 2, 10, 92, '2008-04-01', '2009-12-01', 'Usep- Research division/ University Funded Project', '42000.00', NULL, NULL, NULL, 'Assessment of Existing Strands....pdf', 185166, 1, 1, '5ed3c6a0-c880-11e8-9bd6-e11af0701d8a', '2018-10-18 21:55:33', '2018-10-18 21:55:33');
