('a1084c10-1a1c-11e9-8af4-11a3a7aeb1a1', 'Community Based Mapping in CABADBARAN CITY using Google Map Makers Technology', '\"[{\\\"id\\\":0,\\\"name\\\":\\\"Dr. Marilyn B. Castillo\\\"},{\\\"id\\\":1,\\\"name\\\":\\\" Engr. Ronald Monzon\\\"}]\"', 'Community Based Mapping in CABADBARAN CITY using Google Map Makers Technology                                            <h3></h3>', 'Community Based Mapping', 4, 23, 229, '2014-01-01', '2015-01-01', 'CSUCC', '60000.00', 'CSUCC', '9.117611', '125.53525890000003', 'page-11.pdf', 784677, 1, 1, 'f391d750-154c-11e9-a41d-95bdcaf5c7ad', '2019-01-16 21:56:27', '2019-01-16 21:56:27'),
('a10fdc30-ccf4-11e8-b9c1-f77cd8d8ab1f', '3D Mapping of MSU Aga Khan Museum', '\"[{\\\"id\\\":0,\\\"name\\\":\\\"Kimberly Palaran\\\"}]\"', '<h3>Abstract</h3><br>\r\n                                            write here...<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 12pt; text-align: justify;\">The\r\nfocus of this paper is to exhibit a virtual replica of the Aga-Khan Museum with\r\ncomplete 360-degree accessibility and to provide users the look of the actual\r\nmuseum and artifacts found inside it.</span><p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align:justify;line-height:150%\"><span style=\"font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We argued that mere preservation\r\nwill not be enough to protract the life of each artifacts found inside the Aga\r\nKhan Museum. We showed that there is another way to withstand the existence of\r\neach artifact which is by means of virtual preservation. This virtual\r\npreservation has been the alleviation of technology to preserve and sustain the\r\nartifacts. <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align:justify;text-indent:.5in;\r\nline-height:150%\"><span style=\"font-size:12.0pt;line-height:150%;font-family:\r\n&quot;Times New Roman&quot;,serif\">It is not just preserving it in an advance level but\r\nthe usage of it has now become widespread; especially in education purposes. As\r\nthey call it “edutainment”, which means education plus entertainment. This is\r\ndue to the fact that the realistic and immersive representations that can be\r\nachieved will capture the attention of the users of such application and, at\r\nthe same time, are able to deliver a lot of heterogeneous information, unlike any\r\nother methods used before. <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align:justify;text-indent:.5in;\r\nline-height:150%\"><span style=\"font-size:12.0pt;line-height:150%;font-family:\r\n&quot;Times New Roman&quot;,serif\">In line with this, the developer develop a system\r\ncalled <i>3D Mapping of MSU Aga Khan Museum</i>;\r\nwhich is a desktop software development project that allows students, visitors,\r\ntourists, and other interested parties to have a virtual tour in the Aga Khan\r\nMuseum. It features modules such as wandering aimlessly in 360-degree inside\r\nthe applications software, select from different galleries inside the museum,\r\ncan view the artifact and its information respectively.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"text-align:justify;text-indent:.5in;\r\nline-height:150%\"><span style=\"font-size:12.0pt;line-height:150%;font-family:\r\n&quot;Times New Roman&quot;,serif\">. This project aims to provide an accessible\r\ninformation about the Aga Khan Museum and its artifact collections especially\r\nfor those who are far away from MSU. This is also to promote the Aga Khan\r\nMuseum to all kinds of interested constituents such as virtual tour enthusiast,\r\nscholars and researchers, tourists and visitors outside Mindanao State\r\nUniversity.<o:p></o:p></span></p>', 'virtual tour,3D tour,Mapping,VR,Aga Khan,MSU,Museum,virtual reality,360 VR,360', 1, 3, 18, '2018-01-01', '2018-07-01', NULL, NULL, NULL, NULL, NULL, '1 cover page.pdf', 84396, 0, 1, '50804a60-ccf3-11e8-a11c-1fd19737ee1a', '2018-10-10 17:26:08', '2018-10-10 17:26:08'),
