('d608f780-d362-11e8-9648-3ff65064454b', 'Seed Quality Evaluation and Production Assessment', '\"[{\\\"id\\\":0,\\\"name\\\":\\\"FOR. CARLO D. ALVAREZ\\\"}]\"', '<h3>Abstract</h3><table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" width=\"938\" style=\"width: 703.2pt; border: none;\">\r\n <tbody><tr style=\"mso-yfti-irow:0;mso-yfti-firstrow:yes;mso-yfti-lastrow:yes;\r\n  height:73.15pt\">\r\n  <td width=\"127\" valign=\"top\" style=\"width:95.3pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0in 5.4pt 0in 5.4pt;height:73.15pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n  normal\"><span lang=\"EN-PH\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; T</span><span lang=\"EN-PH\" style=\"\">his\r\n  study was conducted to assess and evaluate some of the qualitative\r\n  performances of Mollocansau sau (Paraserianthes falcataria (L.) Nielsen)\r\n  seeds collected from identified plus trees (PT) in USeP Bislig Campus, Bislig\r\n  City.<o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n  normal\"><span lang=\"EN-PH\" style=\"\">A\r\n  total of 12 stands of plus tree were considered and at the same time seeds\r\n  were collected from these stands to generate major materials of this study.<o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n  normal\"><span lang=\"EN-PH\" style=\"\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Both\r\n  PT number 4, 8, and 33 obtained highest purity test which is 94%. While the\r\n  lowest value was observed in PT number 8 with 80%, however, the mean purity\r\n  test for the entire seed samples is 87.91%.<o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n  normal\"><span lang=\"EN-PH\" style=\"\">High\r\n  value on viability test was found out in PT 12 and the lowest value were both\r\n  observed in PT number 58 and 64 with 76%, while its mean value is 83.64%.<o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n  normal\"><span lang=\"EN-PH\" style=\"\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Results\r\n  of germination test and germination capacity have a mean value of 70% and\r\n  86%, respectively. Lastly, its mean germination energy is 46.86 with mean\r\n  energy period of 19.67 days.<span style=\"font-size: 12pt;\"><o:p></o:p></span></span></p>\r\n  </td>\r\n </tr>\r\n</tbody></table><br>', 'Seed Collection,test on purity and viability,germination behavior', 2, 10, 92, '2008-07-01', '2008-10-01', 'Usep- Research division/ University Funded Project', '16000', NULL, NULL, NULL, 'Seed Quality Evaluation and Production Assessment.pdf', 406488, 1, 1, '5ed3c6a0-c880-11e8-9bd6-e11af0701d8a', '2018-10-18 21:50:08', '2018-10-18 21:50:08'),
