INSERT INTO `morss_questions` (`id`, `question`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Do you clearly understand your organization\'s policies and goals?', NULL, NULL, NULL),
(2, 'Has your superior ably translated your organization\'s objectives into meaningful assignments and goals for you?', NULL, NULL, NULL),
(3, 'Do you find your job interesting and challenging?', NULL, NULL, NULL),
(4, 'Do you get any satisfaction from your work?', NULL, NULL, NULL),
(5, 'Do you think you are getting a fair remuneration package (salary, bonus, allowances, and other benefits) for your job?', NULL, NULL, NULL),
(6, 'Are you sufficiently recognized by your superior for performing a good job?', NULL, NULL, NULL),
(7, 'Are you given adequate training and coaching to help you develop your potential?', NULL, NULL, NULL),
(8, 'Does your superior take time to discuss with you your performance, growth and development?', NULL, NULL, NULL),
(9, 'Do you think the amount of trust, cooperation, understanding and warmth that exists both among staff and between staff and management is high?', NULL, NULL, NULL),
(10, 'Do you think teamwork in your department is good?', NULL, NULL, NULL),
(11, 'Do you think there are good career opportunities and good chance for advancement in your organization?', NULL, NULL, NULL),
(12, 'Do you think you do not need to play politics to get ahead in your organization?', NULL, NULL, NULL),
(13, 'Do you think the management implements your organization\'s policies fairly?', NULL, NULL, NULL),
(14, 'Can you trust the management and believe in what they say?', NULL, NULL, NULL),
(15, 'Is communication in your organization effective, both among staff and between management and staff?', NULL, NULL, NULL),
(16, 'Do you think the feelings, ideas and suggestions of staff are communicated to the management?', NULL, NULL, NULL),
(17, 'Are you willing to put in efforts beyond that normally expected in order to help your organization be successful?', NULL, NULL, NULL),
(18, 'Do you want to continue to work for your organization in the next 5 years?', NULL, NULL, NULL);
