('4c280290-1ade-11e9-b973-55c2d3015345', 'An Agent-Based Computer Simulation on Banana Bunchy Top Disease', '\"[{\\\"id\\\":0,\\\"name\\\":\\\"Ador R. Picaza\\\"},{\\\"id\\\":1,\\\"name\\\":\\\"                      Douglas M. Doloriel\\\"},{\\\"id\\\":2,\\\"name\\\":\\\"                  Nancy S. Doloriel\\\"}]\"', 'An Agent-Based Computer Simulation on Banana Bunchy Top Disease                                            <h3></h3>', 'Banana Bunchy Top Disease', 2, 10, 92, '2018-01-01', '2018-12-01', 'SDSSU', '5000.00', 'Tandag City,Surigao Del Sur', '9.101171100000002', '126.15887709999993', 'page-9.pdf', 663195, 1, 1, 'f391d750-154c-11e9-a41d-95bdcaf5c7ad', '2019-01-17 21:02:47', '2019-01-17 21:02:47'),
