('744d8e40-d365-11e8-bebe-b11174294e6a', 'Flowering and Fruiting Habits of Paserianthes falcate (Mollucan sau): A Phenological Study', '\"[{\\\"id\\\":0,\\\"name\\\":\\\"FOR. WHELSON C. PASOS\\\"}]\"', '<h3>Abstract</h3><br><table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" width=\"938\" style=\"width: 703.2pt; border: none;\">\r\n <tbody><tr style=\"mso-yfti-irow:0;mso-yfti-firstrow:yes;height:73.15pt\">\r\n  <td width=\"127\" valign=\"top\" style=\"width:95.3pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0in 5.4pt 0in 5.4pt;height:73.15pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n  normal\"><span lang=\"EN-PH\" style=\"\">Phenological\r\n  study was conducted for two years, with aims to achieve the following\r\n  objectives: (a) document the phenological calendar or the seasonal patterns\r\n  or of flowering and fruiting of Mollucan/falcate sau d; (b) rate of the\r\n  flower and fruiting habit using floral assessment method in 13 plus trees;\r\n  and (c) compare with the phenological guide book in CARAGA Region by Gilbero\r\n  et al (2008).<o:p></o:p></span></p>\r\n  </td>\r\n </tr>\r\n <tr style=\"mso-yfti-irow:1;mso-yfti-lastrow:yes;height:73.15pt\">\r\n  <td width=\"127\" valign=\"top\" style=\"width:95.3pt;border:solid windowtext 1.0pt;\r\n  border-top:none;mso-border-top-alt:solid windowtext .5pt;mso-border-alt:solid windowtext .5pt;\r\n  padding:0in 5.4pt 0in 5.4pt;height:73.15pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n  normal\"><span lang=\"EN-PH\" style=\"\">Twelve\r\n  (12) plus trees were directly observed weekly in terms of floristic\r\n  development. It was observed that between June and July is the best time for\r\n  the collection seeds for 2008 floral assessment was noted be the best season\r\n  of flowering and fruiting of Mollocan sau, while 2009 observation has changed\r\n  the flowering pattern this due climate change and the impact of seed\r\n  collection technology applied in previous (2008) seed collection.<span style=\"font-size: 12pt;\"><o:p></o:p></span></span></p>\r\n  </td>\r\n </tr>\r\n</tbody></table>', 'Flowering and Fruiting,f Paserianthes falcate (Mollucan sau)', 2, 10, 92, '2008-01-01', '2009-12-01', 'Usep- Research division/ University Funded Project', '42000.00', NULL, NULL, NULL, 'Flowering and Fruiting Habits of Paserian falcate.pdf', 418363, 1, 1, '5ed3c6a0-c880-11e8-9bd6-e11af0701d8a', '2018-10-18 22:08:53', '2018-10-18 22:08:53'),
