('980e6de0-1869-11e9-b056-a9c4f174bd4f', 'Status of Dominant Small Pelagic in Hinatuan Passage Caraga Region, Philippines', '\"[{\\\"id\\\":0,\\\"name\\\":\\\"Joyce M. Baclayo\\\"},{\\\"id\\\":1,\\\"name\\\":\\\"Romeo C. Deligero\\\"},{\\\"id\\\":2,\\\"name\\\":\\\"Laila M. Holoyohoy\\\"},{\\\"id\\\":3,\\\"name\\\":\\\"Eunice C. Bognot\\\"}]\"', '<h3>Abstract</h3><p><br></p><p>Rastrelliger kanagurta, Selar crumneopthalmus, Decapterus russeli and Amblygaster sirm were the dominant small pelagic fishes in Hinatuan Passage contributing 32% of the total production in the area. This paper presents the status of these four dominant small pelagic fishes as to their abundance, seasonality, length frequency, distribution and population parameters relevant to the management and sustainability of the fishery resources in the area. Result show that commercial Danish seine, Ring nets , Bagnets and municipal multiple hook and line gillnets, were the main fishing gears exploiting these four small pelagic fishes. It was shown further in the analysis of fish samples that these gears caught an average of 77% immature fish which did not even reach its length infinity (L) rate (K) and length infinity (L) vary by species. The present level of exploitation rates ranged from 0.4-0.84 is an indication of biological over fishing.&nbsp;</p>', 'Small Pelagic species,Rastrelliger kanaguurta,selar crumneophthalmus,Decapterus russeli and Amblygaster sirm) catch per unit effort, population parameters', 2, 10, 95, '2004-01-01', '2013-12-01', 'BFAR', '200000000', 'Hinatuan, Surigao Del Sur Philippines', '9.7082804', '125.80617789999997', 'BFAR 1.pdf', 507624, 1, 0, '5ed3c6a0-c880-11e8-9bd6-e11af0701d8a', '2019-01-14 18:02:21', '2019-01-14 18:02:21'),
