('e1549f20-d2a4-11e8-9172-27379affb8c2', 'Predictors of Passing Probabilities in the Licensure Examination to Electrical Engineering and Forestry', '\"[{\\\"id\\\":0,\\\"name\\\":\\\"Dr. Anastacio G. Pantaleon\\\"}]\"', '<p>                                            <h3>Abstract</h3>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br><span lang=\"EN-PH\" style=\"line-height: 107%;\">This study was aimed to create a model which\r\ncould establish predictors of passing probabilities in the licensure\r\nexamination for the Bachelor of Science in Electrical Engineering and Bachelor\r\nof Science in Forestry programs. Binary Logistics Regression was used to\r\nevaluate the USEPAT entrance examination, high school general percent average,\r\ncollege general percent average, grades in the professional subjects, and\r\ngrades in the major subjects, in the attempt to establish a forecast model.\r\nFindings revealed that none of these tested variables were relevant to the\r\npredictability of their respective licensure examinations.</span><br></p>', 'Licensure model, Logistics Regression ,Forestry,Electrical Engineering', 4, 23, 228, '2018-01-01', '2018-12-01', 'Usep- Research division/ University Funded Project', '0', NULL, NULL, NULL, 'Predictors of Passing Probabilities....pdf', 179655, 1, 0, '5ed3c6a0-c880-11e8-9bd6-e11af0701d8a', '2018-10-17 23:10:23', '2018-10-17 23:10:23'),
